import React from "react";
import { Container, Box, Text } from "@chakra-ui/react";

const Homepage = () => {
  return (
    <Container maxW="xl" centerContent my={8} p={3}>
      <Box
        display="flex"
        justifyContent="center"
        p={3}
        bg={"white"}
        w="100%"
        m="40 px 0 15 px 0"
        borderRadius={"lg"}
        borderWidth={"1px"}
      >
        <Text fontSize="4xl">
          Talk-A-Tive
        </Text>
      </Box>
    </Container>
  );
};

export default Homepage;
